import React from 'react';

import SearchBar from './SearchBar';
import axios from 'axios';

const App = () => {

    const searchAction = async (term) => {
        console.log(term);
        const results = await youtube.get('https://www.googleapis.com/youtube/v3/search', {
            params: {
                key: 'AIzaSyDkUfdyq7o6LvpG4mmgM_REGLWy5CvBQf8',
                part: term
            }
        });

        console.log(results);
    }

    return (
        <div className="ui container" style={{ marginTop: '20px' }} >
            <SearchBar submithandler={searchAction} />
        </div>
    )
}


export default App;
